import classes from './GoBackHeader.module.css';
import { Link } from 'react-router-dom';

const GoBackHeader = () => {
  return <div className={classes.Box}>
      <Link to={'/'} className={classes.Btn}>Go back</Link>
  </div>;
};

export default GoBackHeader;
